/* A binary tree node has data, pointer to left child
   and a pointer to right child  
struct Node
{
    int data;
    Node* left;
    Node* right;
}; */


class Solution
{
    public:

    
    vector<int> serialize(Node *root) 
    {
        //Your code here
        vector<int> ans;
        if(root==NULL)
        {
            return ans;
        }
         queue<Node*> q;
         q.push(root);
         while(!q.empty())
         {
             Node* node = q.front();
             q.pop();
             if(node==NULL)
             {
                 ans.push_back(-1);
             }
             else
             {
                 ans.push_back(node->data);
             }
             if(node!=NULL)
             {
                 q.push(node->left);
                 q.push(node->right);
             }
         }
        return ans;
    }
    
    //Function to deserialize a list and construct the tree.
    Node * deSerialize(vector<int> &A)
    {
      int index = 0;
      if(A.size()==index)
      {
          return NULL;
      }
      int val = A[index++];
      if(val==-1)
      {
          return NULL;
      }
      Node* root = new Node(val);
      queue<Node*> q;
      q.push(root);
      while(!q.empty())
      {
           Node* node = q.front();
           q.pop();
           val = A[index++];
           if(val==-1)
           {
               node->left=NULL;
           }
           else
           {
               Node* temp1 = new Node(val);
               node->left= temp1;
               q.push(temp1);
           }
           val = A[index++];
           if(val==-1)
           {
               node->right = NULL;
           }
           else
           {
                Node* temp2 = new Node(val);
               node->right= temp2;
               q.push(temp2);
           }
      }
      return root;
       
    }

};

//{ Driver Code Starts.

void inorder(Node *root) {
    if (root == NULL)
        return;
    inorder(root->left);
    cout << root->data << " ";
    inorder(root->right);
}

void _deleteTree(Node* node)  
{  
    if (node == NULL) return;  
  
    /* first delete both subtrees */
    _deleteTree(node->left);  
    _deleteTree(node->right);  
  
    /* then delete the node */
    //cout << "Deleting node: " << node->data << endl;  
    delete node;  
}  
  
/* Deletes a tree and sets the root as NULL */
void deleteTree(Node** node_ref)  
{  
    _deleteTree(*node_ref);  
    *node_ref = NULL;  
}  

int main() {
    int tc;
    scanf("%d ", &tc);
    while (tc--) {
        string treeString;
        getline(cin, treeString);
        Node *root = buildTree(treeString);
        
        Solution serial, deserial;
        vector<int> A = serial.serialize(root);
        deleteTree(&root);
        Node *getRoot = deserial.deSerialize(A);
        inorder(getRoot);
        cout << "\n";

    }


    return 0;
}
