#include <iostream>
#include <string>

struct Node {
    std::string question;
    std::string answer;
    Node* next;
};

class Quiz {
private:
    Node* head;
    int score;
public:
    Quiz() : head(NULL), score(0) {}

    void addQuestion(std::string question, std::string answer) {
        Node* newNode = new Node();
        newNode->question = question;
        newNode->answer = answer;
        newNode->next = head;
        head = newNode;
    }

    void startQuiz() {
        Node* temp = head;
        std::string userAnswer;

        while (temp != NULL) {
            std::cout << temp->question << std::endl;
            std::cin >> userAnswer;

            if (userAnswer == temp->answer) {
                score++;
                std::cout << "Correct!" << std::endl;
            }
            else {
                std::cout << "Wrong! The correct answer is: " << temp->answer << std::endl;
            }

            temp = temp->next;
        }

        std::cout << "Your score is: " << score << "/10" << std::endl;
    }
};

int main() {
    Quiz quiz;

    // Add your questions and answers here
    quiz.addQuestion("What is 2^2 ?", "4");
    quiz.addQuestion("What is inches in centimeter", "2.54");
    quiz.addQuestion("A number system that only contains 1 and 0", "binary");
    quiz.addQuestion("What is 1 + 1", "2");
    quiz.addQuestion("A pulse in binary", "bit");
    quiz.addQuestion("If theres a fruit name orange what is the color of the fruit?", "orange");
    quiz.addQuestion("If i have a bird that doesnt fly what is the name of my bird?", "2.54");
    quiz.addQuestion("A bird that that has wings but doesnt fly", "ostrich");
    quiz.addQuestion("What is the derivative of x", "1");
    quiz.addQuestion("What is the integral of x^2", "1/2x");

    quiz.startQuiz();

    return 0;
}

