#include <iostream>
using namespace std;

typedef struct node{
	int c;
	int e;
	node *next;
}node;

class Poly{
	public:
	node *head;
	node *tail;
	
	Poly(){
		head = new node;
		tail = nullptr;
		head->next = tail;
	}
	
	void add(int x, int y){
		node *tmp = head->next;
		node *pre = head;
		while(tmp != nullptr && tmp->e > y){
			tmp = tmp->next;
			pre = pre->next;
		}
		if(tmp != nullptr && tmp->e == y){
			tmp->c += x;
		}
		else{
			node *new_node = new node;
			new_node->c = x;
			new_node->e = y;
			pre->next = new_node;
			new_node->next = tmp;
		}
		if(tmp != nullptr && tmp->c == 0){
			pre->next = tmp->next;
			delete tmp;
		}	
	}

	void print(){
		node *tmp = head->next;
		if(tmp == nullptr){
			cout << "0 0\n";
		}
		while(tmp != nullptr){
			cout << tmp->c << " " << tmp->e << "\n";
			tmp = tmp->next;
		}
	}
	
	Poly operator+(Poly P){
		Poly ans = Poly();
		node *tmp = (P.head)->next;
		while(tmp != nullptr){
			ans.add(tmp->c, tmp->e);
			tmp = tmp->next;
		}
		tmp = head->next;
		while(tmp != nullptr){
			ans.add(tmp->c, tmp->e);
			tmp = tmp->next;
		}
		return ans;
	}
	
	Poly operator*(Poly P){
		Poly ans = Poly();
		node *tmp = (P.head)->next;
		while(tmp != nullptr){
			node *tmp2 = head->next;
			while(tmp2 != nullptr){
				ans.add((tmp->c)*(tmp2->c), (tmp->e)+(tmp2->e));
				tmp2 = tmp2->next;
			}
			tmp = tmp->next;
		}
		return ans;
	}
};

int main() {
	int test_case = 1;
	while(1){
		int P;
		cin >> P;
		Poly poly_P = Poly();
		for(int i=0;i<P;i++){
			int x, y;
			cin >> x >> y;
			poly_P.add(x, y);
		}
		int Q;
		cin >> Q;
		Poly poly_Q = Poly();
		for(int i=0;i<Q;i++){
			int x, y;
			cin >> x >> y;
			poly_Q.add(x, y);
		}
		if(P == 0 && Q == 0)
			break;
		cout << "Case" << test_case << ":\n";
		cout << "ADD\n";
		Poly poly_sum = poly_P + poly_Q;		
		poly_sum.print();
		cout << "MULTIPLY\n";
		Poly poly_mul = poly_P * poly_Q;
		poly_mul.print();
		test_case++;
	}
	return 0;
}
